part of 'fetch_time_tracking_cubit.dart';@immutableabstract class FetchTimeTrackingState {}class FetchTimeTrackingInitial extends FetchTimeTrackingState {}class FetchTimeTrackingLoading extends FetchTimeTrackingState {}class FetchTimeTrackingSuccessfully extends FetchTimeTrackingState {  final List<TimeTrackingEntity> times;  FetchTimeTrackingSuccessfully({required this.times});}class FetchTimeTrackingError extends FetchTimeTrackingState {  final String message;  FetchTimeTrackingError({required this.message});}